import { callApi } from '../callApi';

export async function loadServerStatus() {
  return callApi({
    pathname: `/api/apm/status/server`
  });
}

export async function loadAgentStatus() {
  return callApi<{ dataFound: boolean }>({
    pathname: `/api/apm/status/agent`
  });
}
